using NUnit.Framework;
using SmartCardApi.Infrastructure;

namespace SmartCardApi
{
    [TestFixture]
    public class TLVTests
    {
        [Test]
        public void Parse_BER_TLV()
        {
            var parsedTvl = new BerTLV(
                                new BinaryHex("6F1A840E315041592E5359532E4444463031A5088801025F2D02656E")
                            );

            Assert.AreEqual(
                    "6F",
                    parsedTvl.T
                );
            Assert.AreEqual(
                    "840E315041592E5359532E4444463031A5088801025F2D02656E",
                    parsedTvl.V
                );

            Assert.AreEqual(
                    "84",
                    parsedTvl.Data[0].T
                );
            Assert.AreEqual(
                    "315041592E5359532E4444463031",
                     parsedTvl.Data[0].V
                );

            Assert.AreEqual(
                    "A5",
                    parsedTvl.Data[1].T
                );
            Assert.AreEqual(
                    "8801025F2D02656E",
                     parsedTvl.Data[1].V
                );

            Assert.AreEqual(
                    "88",
                    parsedTvl.Data[1].Data[0].T
                );
            Assert.AreEqual(
                    "02",
                     parsedTvl.Data[1].Data[0].V
                );

            Assert.AreEqual(
                    "5F2D",
                    parsedTvl.Data[1].Data[1].T
                );
            Assert.AreEqual(
                    "656E",
                     parsedTvl.Data[1].Data[1].V
                );
        }

        //75 82 1FDA 7F

        [Test]
        public void Parse_BER_TLV_2()
        {
            var parsedTvl = new BerTLV(
                                new BinaryHex("75821FDA7F")
                            );

            Assert.AreEqual(
                    "75",
                    parsedTvl.T
                );
            Assert.AreEqual(
                    "821FDA",
                    parsedTvl.L
                );
            Assert.AreEqual(
                    "7F",
                    parsedTvl.V
                );
        }

